import Hero from "../components/Hero"
import Hm from "../components/Hm.png"
function Home(){
    return(
        <>
            <Hero cname="hero"
             image={Hm}
             title="your journey your story"
             text="choose your favouite destination."
             buttontext="travel plan1q"
            />
        </>
    )
}
export default Home
